"Fans of the late, great Blood Feathers (or, if you are a truly old head, Aspera) may have recognized the sweet, dulcet Petty-ish tones of one Drew Mills opening up last night’s sold-out War On Drugs show at Union Transfer. And indeed, that was he, resurfacing for his first gig under the moniker A.M. Mills, with the above track going online this morning. “Wreckin’ My World” is the first public offering from a full album of stuff in the can recorded by Terry Yerves and mixed by Quentin Stoltzfus (Mazarin, Light Heat). Mills is currently sorting out plans for the record’s release and booking some local gigs. Keep an eye out for this one." -Philebrity","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atjmbo.jpg","width":500,"height":500},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atjmbo1.jpg","width":500,"height":500},"large":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atlg.jpg","width":300,"height":300},"large1":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atlg1.jpg","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atmd.jpg","width":200,"height":200},"medium1":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atmd1.jpg","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-og.jpg","width":500,"height":500},"small":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atsm.jpg","width":100,"height":100},"small1":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atsm1.jpg","width":100,"height":67},"square":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-sq.jpg","width":100,"height":100},"squareSmall":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-sqsm.jpg","width":60,"height":60},"xlarge":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atxl.jpg","width":500,"height":500},"xlarge1":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atxl1.jpg","width":500,"height":334},"xxlarge":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atxxl.jpg","width":500,"height":500},"xxlarge1":{"path":"http://cdn.ticketfly.com/i/00/00/99/24/45-atxxl1.jpg","width":650,"height":433}},"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"https://soundcloud.com/am-mills/wreckin-my-world","urlMySpace":"","urlFacebook":"","urlTwitter":"","twitterScreenName":""},{"id":1769845,"name":"August Wells","startTime":null,"eventDescription":"August Wells is a collection of songs and arrangements with vocals, electric guitar and piano with violin, percussion and various wind instruments.","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://www.augustwells.com/","urlMySpace":"","urlFacebook":"https://www.facebook.com/augustwellsband","urlTwitter":"http://twitter.com/AugustWellsBand","twitterScreenName":"AugustWellsBand"},{"id":492361,"name":"Joey Sweeney","startTime":null,"eventDescription":"Joey has been writing songs and non-fiction since he was a teenager in the 1980s. Over the years, he has fronted the groups The Barnabys and The Trouble With Sweeney, as well as recording and performing as a solo artist. Meanwhile, he’s also written for a wide array of publications, including Salon.com, Philadelphia Weekly, the Philadelphia Inquirer and his daily perch, Philebrity.com, a cityblog he established in 2004. His songs and records have received widespread critical acclaim over the years; of his last record with The Trouble With Sweeney, Fishtown Briefcase, Pitchfork said “[Sweeney] mixes autobiography and fiction against the group’s 70s-inflected indie pop, resourceful— and unabashed— enough to digress into an E Street interlude or an AM-rock guitar coda.” He’s also garnered curse and praise as a writer of prose, having won the AAN Award for Music Criticism and appeared in Best Music Writing 2002. From 2004 through 2010, Sweeney mostly shied from performing and recording, focusing instead on his role as Publisher & Editor of the website Philebrity.com. In 2011, however, Sweeney stepped back into his old role of singer-songwriter, this time fronting the rock band Arctic Splash. Joey Sweeney Your Life Is Calling compiles the best of everything before the Splash. 

